  true,\n\t\"url\": null,\n\t\"notes\": \"Monthly report that provides national trade
  data including imports, exports, and balance of payments for goods and services.
  Statistics are also reported on a year-to-date basis. Data are continuously compiled
  and processed. Documents are collected as shipments arrive and depart, and are processed
  on a flow basis. The BEA uses the data to update U.S. balance of payments, gross
  domestic product, and national accounts. Other federal agencies use them for economic,
  financial, and trade policy analysis (such as import/export promotion studies and
  import/export price indexes). Private businesses and trade associations use them
  for domestic and overseas market analysis, and industry-, product-, and area-based
  business planning. Major print and electronic news media use them for general and
  business news reports.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
